      "content": "gov.bbg.voa\norg.rferl.ui.activity.article.ArticleListPagerActivity\nfacaaf3462e153d19d9088dc4cf49d3e\ngov.bbg.voa:id/swipe_container,gov.bbg.voa:id/actionbar_share_anchor,android:id/navigationBarBackground,gov.bbg.voa:id/actionbar_logo,gov.bbg.voa:id/f_audio_player_collapsed_description,android:id/list,gov.bbg.voa:id/pagetitle_title,gov.bbg.voa:id/li_article_texts,gov.bbg.voa:id/li_article_audio,gov.bbg.voa:id/li_article_multimedia,gov.bbg.voa:id/li_article_pubdate,gov.bbg.voa:id/pageTitle,gov.bbg.voa:id/li_article_favorite,gov.bbg.voa:id/f_audio_player_collapsed_stop,gov.bbg.voa:id/f_audio_player_collapsed_separator1,gov.bbg.voa:id/slidingmenumain,gov.bbg.voa:id/f_audio_player_collapsed_title,gov.bbg.voa:id/viewPager,gov.bbg.voa:id/audio_player,gov.bbg.voa:id/action_bar,gov.bbg.voa:id/f_audio_player_collapsed_play,gov.bbg.voa:id/decor_content_parent,gov.bbg.voa:id/li_article_img_part,android:id/statusBarBackground,gov.bbg.voa:id/pagetitle_next,gov.bbg.voa:id/back_button,android:id/content,gov.bbg.voa:id/audio_player_shadow,gov.bbg.voa:id/f_audio_player_switcher,gov.bbg.voa:id/li_article_multimedia_with_title,gov.bbg.voa:id/li_article_title,gov.bbg.voa:id/pagetitle_previous,gov.bbg.voa:id/actionbar_center_frame,gov.bbg.voa:id/li_article_thumbnail,gov.bbg.voa:id/action_bar_container,gov.bbg.voa:id/actionbar_main\n\u1205\u12c8\u1213\u1275 45 \u12d3\u1218\u1275 \u1206\u1290\u12cd,\uf006,05/03/2020 12:11 \u1325\u12cb\u1275,\u12e8\u120a\u1262\u12eb \u1218\u1295\u130d\u1225\u1275 \u12a8\u1304\u1294\u126b \u12e8\u1230\u120b\u121d \u12f5\u122d\u12f5\u122d \u12c8\u1323,07/02/2020 10:27 \u12a8\u1230\u12d3\u1275,\u12e8\u1355\u122c\u12da\u12f3\u1295\u1275 \u12a2\u1233\u12eb\u1235 \u1243\u1208 \u121d\u120d\u120d\u1235,25/02/2020 3:17 \u12a8\u1230\u12d3\u1275,\uf025,\u12e8\u1273\u120b\u1241 \u121b\u12ad\u1230\u129e Super Tuesday \u12e8\u1245\u12f5\u1218 \u121d\u122d\u132b \u1202\u12f0\u1275 \u1232\u1308\u1218\u1308\u121d,19/02/2020 8:14 \u12a8\u1230\u12d3\u1275,04/03/2020 6:59 \u12a8\u1230\u12d3\u1275,19/02/2020 5:45 \u12a8\u1230\u12d3\u1275,\u12e8\u1200\u12cb\u1233 \u12e8\u12a8\u1270\u121b \u1340\u1325\u1273\u1293 \u1230\u120b\u121d \u1309\u12f3\u12ed,19/02/2020 5:17 \u12a8\u1230\u12d3\u1275,04/03/2020 8:04 \u12a8\u1230\u12d3\u1275,\u12e8\u1285\u12f3\u1234 \u130d\u12f5\u1265\u1295 \u12a0\u1235\u1218\u120d\u12ad\u1276 \u1260\u121a\u12ab\u1204\u12f0\u12cd \u12f5\u122d\u12f5\u122d \u12a2\u1275\u12ee\u1335\u12eb \u12a0\u1275\u1308\u129d\u121d,Gabina VOA is designed to be an infotainment youth radio show broadcasting to Ethiopia and Eritrea in the Amharic language. The show brings varied perspectives on issues concerning young people in the Horn of Africa region. \u201cGabina\u201d in the Amharic language is a front row taxi ride\u2014symbolic of the show\u2019s content as a fun ride that takes audiences from point \u201cA\u201d to point \u201cB\u201d. Gabina VOA\u2019s main goal is Enlightening young people, introducing them to cutting-edge technological innovations, exposing them to new processes and ideas so they can be productive, informed and self-governing citizens.,\u1233\u120d\u126b \u12aa\u122d\u1293 \u122a\u12eb\u12ad \u121b\u1278\u122d \u1260\u12a0\u12f2\u1231 \u12e8\u123d\u130d\u130d\u122d \u1218\u1295\u130d\u1225\u1275 \u121d\u1235\u1228\u1273 \u1309\u12f3\u12ed,\u12e8\u12a6\u1290\u130d \u1218\u130d\u1208\u132b,\u1228\u1261\u12d5\u1361-\u130b\u1262\u1293 VOA,04/03/2020 6:06 \u12a8\u1230\u12d3\u1275,\u12a2\u1275\u12ee\u1335\u12eb \u12cd\u1235\u1325 \u12e8\u120b\u1240 \u1323\u12d5\u121d \u12eb\u1208\u12cd\u1295 \u12e8\u1261\u1293 \u12d3\u12ed\u1290\u1275 \u12e8\u121a\u1208\u12ed \u12cd\u12f5\u12f5\u122d \u1270\u12ab\u1204\u12f0,21/02/2020 4:24 \u12a8\u1230\u12d3\u1275,\u12e8\u12a0\u120d\u1238\u1263\u1265 \u1273\u1323\u1242\u12ce\u127d \u1260\u12ac\u1295\u12eb \u121d\u1225\u122b\u1243\u12ca \u12ad\u134d\u120d 4 \u1230\u12ce\u127d \u1308\u12f0\u1209,\u12e8\u130d\u1265\u1345 \u1218\u122a \u12e8\u1290\u1260\u1229\u1275 \u1206\u1235\u1292 \u1219\u1263\u1228\u12ad \u126091 \u12d3\u1218\u1275 \u12d5\u12f5\u121c\u12eb\u1278\u12cd \u12a0\u1228\u1349,26/02/2020 5:22 \u12a8\u1230\u12d3\u1275,\u12a2\u1275\u12ee\u1335\u12eb", 
