      "content": "gov.bbg.voa\norg.rferl.ui.activity.article.ArticleActivity\n1433a39ece21f141f666208c1f8620ca\ngov.bbg.voa:id/simple_article_image_description,gov.bbg.voa:id/actionbar_share_anchor,gov.bbg.voa:id/f_simple_article_share_divider,gov.bbg.voa:id/f_simple_article_actionPanel,android:id/navigationBarBackground,gov.bbg.voa:id/pagetitle_indicator,gov.bbg.voa:id/simple_article_scrollview,gov.bbg.voa:id/actionbar_logo,gov.bbg.voa:id/pagetitle_title,android:id/empty,gov.bbg.voa:id/f_simple_article_star,gov.bbg.voa:id/simple_article_image,gov.bbg.voa:id/simple_article_content_wrapper,gov.bbg.voa:id/pageTitle,gov.bbg.voa:id/f_simple_article_audio_divider,gov.bbg.voa:id/f_simple_article_browser_divider,gov.bbg.voa:id/f_simple_article_title,gov.bbg.voa:id/slidingmenumain,gov.bbg.voa:id/f_simple_article_audio,gov.bbg.voa:id/f_simple_article_browser,gov.bbg.voa:id/viewPager,gov.bbg.voa:id/audio_player,gov.bbg.voa:id/f_simple_article_content,gov.bbg.voa:id/action_bar,gov.bbg.voa:id/simple_article_buttons_wrapper,gov.bbg.voa:id/decor_content_parent,android:id/statusBarBackground,gov.bbg.voa:id/pagetitle_next,gov.bbg.voa:id/f_simple_article_share,gov.bbg.voa:id/back_button,android:id/content,gov.bbg.voa:id/f_simple_article_authors,gov.bbg.voa:id/pagetitle_previous,gov.bbg.voa:id/actionbar_center_frame,gov.bbg.voa:id/action_bar_container,gov.bbg.voa:id/actionbar_main\n\uf1e0,\u1218\u122b\u1214 \u1325\u1260\u1265 \u1273\u12f0\u1230 \u12c8\u122d\u1241,1/2,\uf006,\u12e8\u122b\u12f2\u12ee \u1218\u1345\u1214\u1275,\uf028,\u12e8\u1219\u12da\u1243 \u121d\u1275\u1203\u1275,\u1355\u122e\u134c\u1230\u122d \u12ee\u1293\u1235 \u12a5\u1295\u12f3\u1208 \u12a5\u1293 \u1264\u12da\u1235\u1271 \u1204\u1296\u12ad \u1270\u1218\u1235\u1308\u1295,\uf0ac,\u12a0\u1209\u120b \u12a8\u1260\u12f0 \u2022 17/02/2020\u00a011:02\u00a0\u12a8\u1230\u12d3\u1275,\u201c\u1260\u12dd\u121d\u1273 \u12a8\u1270\u12cb\u1321\u1275 \u1264\u1276\u127d \u12ed\u120d\u1245 \u1260\u130d\u1229\u121d \u1219\u12da\u1243 \u1260\u12f0\u1218\u1241\u1275 \u1264\u1276\u127d \u12e8\u134d\u1245\u122d \u1245\u1218\u1219 \u12ed\u1328\u121d\u122b\u120d\u1362\u201d\u1232\u120d \u12ed\u1295\u12f0\u1228\u12f0\u122b\u120d::\n\n\u12a0\u1235\u1308\u122b\u121a\u12cd \u12e8\u1219\u12da\u1243 \u121d\u1235\u1322\u122d \u12a5\u1293 \u134b\u12ed\u12f3! \u12e8\u1219\u12da\u1243 \u12d3\u1208\u121d \u12c8\u130d \u1290\u12cd \u12e8\u1219\u12da\u1243\u1295 \u134d\u1245\u122d \u12a5\u1293 \u1241\u1325\u122b\u1278\u12cd \u12e8\u1260\u12d9 \u1275\u1229\u134b\u1276\u1279\u1295 \u1218\u120d\u12a8\u1275 \u12e8\u121d\u1293\u12f0\u122d\u130d\u1260\u1275!\n\n\u130d\u1229\u121d \u12e8\u1219\u12da\u1243 \u1225\u120d\u1276\u127d \u1206\u1295 \u1270\u1265\u120e \u1260\u121a\u12f0\u1218\u1325\u1263\u1278\u12cd \u1264\u1276\u127d (\u12e8\u12dd\u121d\u1273 \u12f5\u1263\u1265 \u12ab\u1228\u1260\u1263\u1278\u12cd \u12ed\u120d\u1245) \u134d\u1245\u122d \u12ed\u12f0\u121d\u1245\u1263\u1278\u12cb\u120d\u1362\n\n\u1219\u12da\u1243 \u1218\u1230\u121b\u1271 \u1265\u127b \u1233\u12ed\u1206\u1295 \u1273\u12f2\u12eb \u201c\u1206\u1295 \u1270\u1265\u120e\u201d \u1218\u1206\u1291 \u120b\u12ed \u1290\u12cd \u121a\u1235\u1325\u1229 .. \u12a5\u1295\u12f0 \u1325\u1293\u1276\u1279 \u121d\u120d\u12a8\u1273\u1362\n\n\u201c\u1219\u12da\u1243 \u12e8\u120c\u1208\u1260\u1275 \u1205\u12ed\u12c8\u1275 \u1235\u1205\u1270\u1275 \u12ed\u1206\u1293\u120d\u1362\u201d \u134d\u122c\u12f4\u122a\u12ad \u1292\u1278\n\n\"\u12e8\u1219\u12da\u1243\u1295 \u134d\u1245\u122d \u12a0\u1323\u134b\u132d\u1290\u1275 \u1218\u127c\u1235 \u121b\u1295 \u12eb\u1323\u12cb\u120d?\" \u12ed\u1263\u120d \u12ed\u1206\u1293\u120d\u1362 \u201c\u12dd\u121d\u1273 \u12e8\u1230\u1348\u1290\u1260\u1275\u1295 \u12e8\u1201\u1208\u1275 \u134d\u1245\u1228\u129e\u127d \u12e8\u1218\u1300\u1218\u122a\u12eb \u12e8\u12a5\u122b\u1275 \u121d\u123d\u1275 \u130d\u1295 \u121d\u1295 \u12ed\u1209\u1273\u120d?\u201d \u1232\u120d \u12ed\u1320\u12ed\u1243\u120d \u12a0\u1295\u12f5 \u1273\u12db\u1262\u1362\n\n\u1219\u12da\u1243 \u1235\u121c\u1273\u127d\u1295\u1295 \u1208\u121b\u1233\u1218\u122d .. \u1240\u120d\u1263\u127d\u1295\u1295 \u1208\u121b\u1235\u12a8\u1295 .. \u12a0\u1208\u12eb\u121d\u00a0\u12a8\u12d5\u1208\u1273\u1275\u00a0\u1260\u12a0\u1295\u12f1 \u1260\u1241\u1323 \u1235\u121c\u1275 \u1235\u1295\u130e\u1265\u129d .. \u12eb\u1295 \u12f5\u1295\u1308\u1275 \u12a5\u1295\u12f0 \u12f0\u122b\u123d \u12cd\u1203 \u1233\u12ed\u1320\u1265\u1241\u1275 \u12e8\u1218\u1323 \u1241\u1323 \u1208\u121b\u122d\u1308\u1265 \u12a0\u1295\u12f3\u127d \u120d\u12e9 \u12a0\u1245\u121d \u12e8\u1273\u12f0\u1208 \u1218\u1206\u1291\u1295 \u120d\u1265 \u1265\u1208\u1265 \u12a5\u1295\u12f0\u1201 .. \u12c8\u12ed \u12a5\u1265\u12f0 \u1218\u1238\u1238\u130a\u12eb \u12e8\u121b\u12f5\u122d\u130d \u120d\u121b\u12f5 \u12a0\u1295\u12f1 \u1218\u1295\u1308\u12f3\u127d\u1295 \u12c8\u12f0 \u1218\u1206\u1295 \u1270\u1243\u122d\u1266 \u12a8\u1206\u1290? .. \u1260\u1264\u1275 \u12cd\u1235\u1325 \u12e8\u121d\u1293\u1233\u120d\u134b\u1278\u12cd \u1219\u12da\u1243 \u12a0\u120d\u1263 \u121d\u123d\u1276\u127d\u1293 \u12e8\u12a5\u1228\u134d\u1275 \u130a\u12dc\u12eb\u1275 \u1218\u1265\u12db\u1273\u1278\u12cd \u130d\u1295 \u1260\u12a5\u122d\u130d\u1325 \u1325\u12eb\u1244 \u121b\u132b\u1229 \u12a0\u120d\u1240\u1228\u121d::\n\n\u1208\u1201\u1209\u121d \u12a5\u1235\u12aa \u1206\u1295 \u1265\u1208\u1295 \u1325\u1242\u1275 \u12e8\u1219\u12da\u1243 \u1245\u1218\u121d \u12a8\u1205\u12ed\u12c8\u1273\u127d\u1295 .. \u12a8\u121d\u123d\u1275\u1293 \u12a8\u12a5\u1228\u134d\u1275 \u1240\u1296\u127b\u127d\u1295 \u12a5\u1295\u12f0 \u1323\u12d5\u121d \u121b\u1323\u1348\u132b \u1290\u1235\u1290\u1235 \u12a5\u1293\u12f5\u122d\u130d \u12a5\u1293 \u12e8\u121a\u1206\u1290\u12cd\u1295 \u12a5\u1295\u12ed\u1362\n\n,\u12a0\u1209\u120b \u12a8\u1260\u12f0 \u2022 25/02/2020\u00a011:59\u00a0\u12a8\u1230\u12d3\u1275,\"\u1208\u1325\u1260\u1265 \u12eb\u12f0\u1228 \u121b\u1295\u1290\u1275 \u12a5\u1293 \u1208\u121d\u1233\u120c \u12e8\u121a\u1260\u1243 \u12e8\u1215\u12ed\u12c8\u1275 \u1218\u1295\u1308\u12f5\",\u12a8\u1325\u1242\u1275 \u12c8\u122b\u1275 \u1260\u134a\u1275 \u12cb\u123d\u1295\u130d\u1270\u1295 \u12f2\u1232 \u120b\u12ed \u12e8\u12ad\u1265\u122d \u1240\u1295 \u1270\u12a8\u1265\u122e\u1208\u1273\u120d\u1362 \u12f5\u1295\u1245 \u12e8\u12ae\u122a\u12ee\u130d\u122b\u1348\u122d \u1290\u12cd\u1362 \u1215\u12dd\u1265 \u1208\u1215\u12dd\u1265\u1295 \u1328\u121d\u122e \u1260\u1265\u1204\u122b\u12ca\u1293 \u1260\u12d3\u1208\u121d \u12a0\u1240\u134d \u1218\u12f5\u1228\u12ae\u127d \u1208\u12d5\u12ed\u1273 \u12e8\u1260\u1241 \u1219\u12da\u1243\u12ca \u12f5\u122b\u121b \u1275\u12d5\u12ed\u1295\u1276\u127d\u1295 \u12a0\u12d8\u130b\u1305\u1277\u120d\u1362 \u1260\u1218\u12f5\u1228\u12ad \u1270\u12cb\u1293\u12ed\u1290\u1275\u1293 \u1260\u12a0\u12d8\u130b\u1305\u1290\u1275\u121d \u1220\u122d\u1277\u120d - \u1218\u122b\u1214 \u1325\u1260\u1265 \u1273\u12f0\u1230 \u12c8\u122d\u1241\u1362\n\n\u1235\u1208 \u121e\u12eb \u12ad\u1205\u120e\u1271 \u12a5\u1293 \u1235\u120b\u1260\u1228\u12a8\u1270\u12cd \u1325\u1260\u1263\u12ca \u12a0\u1235\u1270\u12cb\u133e \u12a5\u1295\u12f2\u1201\u121d \u121d\u130d\u1263\u122d\u1293 \u1320\u1263\u12e9 \u12e8\u121e\u12eb \u12a0\u130b\u122e\u1279\u1295 \u1273\u120b\u1245 \u12a0\u12ad\u1265\u122e\u1275\u1293 \u134d\u1245\u122d \u12eb\u1270\u1228\u1348 \u12e8\u12aa\u1290 \u1325\u1260\u1265 \u1230\u12cd \u1290\u12cd\u1362\n\n\u1208\u12d5\u12f5\u121c \u120d\u12ad \u121e\u12eb\u12ca \u12a0\u1235\u1270\u12cb\u133e\u12cd \u12e8\u1270\u1230\u1293\u12f3\u12cd\u1295 \u12e8\u12ad\u1265\u122d \u1240\u1295 \u1218\u1290\u123b \u1260\u121b\u12f5\u1228\u130d \u1235\u1208 \u121e\u12eb \u1215\u12ed\u12c8\u1275 \u12a5\u1293 \u1225\u122b\u12ce\u1279 \u12eb\u12c8\u130b\u1295 \u12d8\u1295\u12f5 \u130b\u1265\u12d8\u1295 \u12a0\u12c8\u12eb\u12ed\u1270\u1290\u12cb\u120d\u1362\n\n\n\u00a0\n\n", 
